import { assert, fail, assertEquals } from "https://deno.land/std/testing/asserts.ts";

function maximumGain(s: string, x: number, y: number): number {
    let maxScore = 0;
    let result: any;

    let memo = new Map<string, number>();

    const gain = (s: string): number => {
        console.log({ s, len: memo.size });
        if (memo.has(s)) {
            return memo.get(s)!;
        }

        const regAB = /ab/g;
        const regBA = /ba/g;
        let maxRes = 0;

        while ((result = regAB.exec(s))) {
            const ss = s.slice(0, result.index) + s.slice(result.index + 2);
            maxRes = Math.max(maxRes, gain(ss) + x);
        }
        while ((result = regBA.exec(s))) {
            const ss = s.slice(0, result.index) + s.slice(result.index + 2);
            maxRes = Math.max(maxRes, gain(ss) + y);
        }

        memo.set(s, maxRes);
        return maxRes;
    };

    return s.split(/[^ab]+/).map(st => gain(st)).reduce((a, b) => a + b)
};

Deno.test("a", () => {
    assertEquals(maximumGain("cdbcbbaaabab", 4, 5), 19);
    assertEquals(maximumGain("aabbaaxybbaabb", 5, 4), 20);
})
